   <div>
      <button onClick={() => run('Puzzle')}>Puzzle</button>
      <button onClick={() => run('Tictac')}>tictac</button>
      {
        part == 'Puzzle' ? <Puzzle /> : part == 'Tictac'
      }
   </div>
  );
}

